DROP TABLE accounts_table;

CREATE TABLE `accounts_table` (
  `id` int NOT NULL AUTO_INCREMENT,
  `members_id` varchar(255) NOT NULL,
  `invoice_no` varchar(255) NOT NULL,
  `invoice_date` varchar(255) NOT NULL,
  `debit_amount` varchar(255) NOT NULL,
  `credit_amount` varchar(255) NOT NULL,
  `blance` varchar(255) NOT NULL,
  `narration` varchar(255) NOT NULL,
  `paid_id` varchar(255) NOT NULL,
  `dues_id` int NOT NULL,
  `blance_id` int NOT NULL,
  `gn_date` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




DROP TABLE admin_user;

CREATE TABLE `admin_user` (
  `id` int NOT NULL AUTO_INCREMENT,
  `first_name` varchar(255) NOT NULL,
  `last_name` varchar(255) NOT NULL,
  `username` varchar(255) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `role` varchar(255) DEFAULT NULL,
  `role_id` varchar(255) DEFAULT NULL,
  `photo` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;




DROP TABLE all_transection_tracking;

CREATE TABLE `all_transection_tracking` (
  `id` int NOT NULL AUTO_INCREMENT,
  `transection_id` text NOT NULL,
  `catagory` text NOT NULL,
  `date` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




DROP TABLE bank_details;

CREATE TABLE `bank_details` (
  `id` int NOT NULL AUTO_INCREMENT,
  `account_code` varchar(255) DEFAULT NULL,
  `bank_name` varchar(255) DEFAULT NULL,
  `account` varchar(255) DEFAULT NULL,
  `amount_credit` varchar(255) DEFAULT NULL,
  `amount_debit` varchar(255) DEFAULT NULL,
  `notes` varchar(255) NOT NULL,
  `date` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

 ","2020-12-01");



DROP TABLE bank_info;

CREATE TABLE `bank_info` (
  `id` int NOT NULL AUTO_INCREMENT,
  `code` varchar(255) NOT NULL,
  `name` varchar(255) NOT NULL,
  `account` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;




DROP TABLE brand_name;

CREATE TABLE `brand_name` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;




DROP TABLE ch_group;

CREATE TABLE `ch_group` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=latin1;




DROP TABLE company_info;

CREATE TABLE `company_info` (
  `id` int NOT NULL AUTO_INCREMENT,
  `company_name_first_part` varchar(255) NOT NULL,
  `comapnay_name_last_part` varchar(255) NOT NULL,
  `address` varchar(255) NOT NULL,
  `tag` varchar(255) NOT NULL,
  `logo` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;




DROP TABLE customers;

CREATE TABLE `customers` (
  `id` int NOT NULL AUTO_INCREMENT,
  `ac_type` varchar(255) CHARACTER SET ucs2 COLLATE ucs2_general_ci DEFAULT NULL,
  `ac` varchar(255) DEFAULT NULL,
  `first_name` varchar(255) DEFAULT NULL,
  `last_name` varchar(255) DEFAULT NULL,
  `mobile_number` varchar(255) DEFAULT NULL,
  `Address` varchar(255) DEFAULT NULL,
  `Company_name` varchar(255) DEFAULT NULL,
  `membership_date` varchar(255) DEFAULT NULL,
  `status` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=337 DEFAULT CHARSET=latin1;

