DROP TABLE daily_transection;

CREATE TABLE `daily_transection` (
  `id` int NOT NULL AUTO_INCREMENT,
  `lederid` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `narration` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `recive_amount` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
