DROP TABLE opening_balance;

CREATE TABLE `opening_balance` (
  `id` int NOT NULL AUTO_INCREMENT,
  `ledger_id` text NOT NULL,
  `debit` text,
  `credit` text,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;




DROP TABLE product_catagory;

CREATE TABLE `product_catagory` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=23 DEFAULT CHARSET=latin1;




DROP TABLE product_location;

CREATE TABLE `product_location` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `address` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




DROP TABLE product_table;

CREATE TABLE `product_table` (
  `id` int NOT NULL AUTO_INCREMENT,
  `product_code` varchar(255) NOT NULL,
  `product_name` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `product_cat_id` varchar(255) NOT NULL,
  `sub_cat_id` text,
  `product_type` text NOT NULL,
  `status` varchar(255) NOT NULL,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=52 DEFAULT CHARSET=latin1;




DROP TABLE product_transection;

CREATE TABLE `product_transection` (
  `id` int NOT NULL AUTO_INCREMENT,
  `invoice_no` text,
  `product_code` varchar(255) NOT NULL,
  `catogry_id` varchar(255) NOT NULL,
  `sub_cat_id` text,
  `location` varchar(255) NOT NULL,
  `quntity` varchar(255) NOT NULL,
  `purches_price` varchar(255) NOT NULL,
  `sale_price` varchar(255) NOT NULL,
  `saler_id` varchar(255) NOT NULL,
  `status_id` varchar(255) DEFAULT NULL,
  `trans_type` varchar(255) DEFAULT NULL,
  `create_date` varchar(255) DEFAULT NULL,
  `update_date` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=216 DEFAULT CHARSET=latin1;




DROP TABLE purchase_invoice;

CREATE TABLE `purchase_invoice` (
  `id` int NOT NULL AUTO_INCREMENT,
  `invoice_no` varchar(100) DEFAULT NULL,
  `suppliar_id` varchar(100) DEFAULT NULL,
  `purchase_total` text,
  `narration` text,
  `payment_status` varchar(100) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  `user_id` varchar(100) DEFAULT NULL,
  `reciept_cat` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC;




DROP TABLE purches_product;

CREATE TABLE `purches_product` (
  `id` int NOT NULL AUTO_INCREMENT,
  `suppliar_ac` varchar(255) DEFAULT NULL,
  `invoice_no` varchar(255) NOT NULL,
  `product_id` varchar(255) NOT NULL,
  `catagory_id` varchar(255) NOT NULL,
  `brand_id` varchar(255) NOT NULL,
  `purches_quntity` varchar(255) NOT NULL,
  `purches_price` varchar(255) NOT NULL,
  `unite_price` varchar(255) NOT NULL,
  `discount` varchar(255) NOT NULL,
  `product_description` varchar(255) NOT NULL,
  `date` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




DROP TABLE return_invoice_details;

CREATE TABLE `return_invoice_details` (
  `id` int NOT NULL AUTO_INCREMENT,
  `return_invoice_id` varchar(100) NOT NULL,
  `kot` varchar(100) NOT NULL,
  `invoice_id` int NOT NULL,
  `product_id` varchar(25) DEFAULT NULL,
  `quantity` int DEFAULT NULL,
  `price` decimal(10,2) DEFAULT NULL,
  `discount` decimal(10,2) DEFAULT NULL,
  `purchase_price` decimal(10,2) DEFAULT NULL,
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `return_date` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_invoice_details_invoices_idx` (`invoice_id`)
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC;




DROP TABLE return_purchase_invoice;

CREATE TABLE `return_purchase_invoice` (
  `id` int NOT NULL AUTO_INCREMENT,
  `order_id` varchar(100) DEFAULT NULL,
